import {useState} from "react";

export default function(){

    const [number, setNumber] = useState('');
    let arrayNums = [];

   return <div>
       <form>
           <label>
               <p>Number:</p>
               <input type="number" value={number} onChange={(e)=>setNumber(e.target.value)}/>
               <ul>
                   {arrayNums.push(number)}
                    {arrayNums.map(n => <li key = {n} > {n} </li>)}
                </ul>
           </label>
       </form>
   </div>
}
